import React, { Component } from 'react';

class SectionApps extends Component {
  render(){

    return(
      <section class="hero is-light">
        <div class="hero-body">
          <div class="container">
            <h1 class="title">
              Hero title
            </h1>
            <h2 class="subtitle">
              Hero subtitle
            </h2>
          </div>
        </div>
      </section>

    );
  }

}

export default SectionApps;
